import styles from './Container.module.css'
import logo from '../img/logoerika.png';
function Container(props) {
  return (

     <><img src={logo} alt="Costs" className={styles.img} /><div className={`${styles.container} ${styles[props.customClass]}`}>
      {props.children}
    </div></>
  )
}

export default Container
